import React from "react";
import { Route, BrowserRouter as Router, Switch } from "react-router-dom";
import "./App.css";

import Header from "./components/Header/Header";
import FooterWrapper from "./components/footer/Footer";
import Banner from "./components/Banner/banner";
import Home from "./components/Home/Home";
import Sorting from "./components/sorting/sorting";
import Search from "./components/Search/serch";
import serchimage from './components/images/serch.svg'
import Mywishlist from "./components/wishlist/mywishlist";
import User from './components/User/UserProfile'
const App: React.FC = () => {
  return (
    <div>
      <Router>
        <Switch>
        <Header/>
        <Route path="/User">
        <User />
        </Route>

        <Header></Header>
        <Banner />

        <div className="serchandsort">
        <div className="sotingadjust">
          <select  className="sort"name="course" id="course">
          <option value="course Price" selected>Course Price </option>
            <option value="Lowtohigh">Low To High</option>
            <option value="hightolow">High To Low</option>
          </select>
          </div>
          <div className="serchadjust">
          <input
            className="serch"
            type="text"
            placeholder="Search order"
          ></input>

          </div>
          </div>   

        <Home />

        </Switch>

      </Router>
    </div>
  );
};

export default App;
